import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h2>Bem-vindo ao Sudoku</h2>
      <p>Faça login ou registre-se para começar a jogar!</p>
      <Link to="/login">
        <button>Login</button>
      </Link>
      <Link to="/register">
        <button>Registrar</button>
      </Link>
    </div>
  );
};

export default Home;
